import React, { Component } from 'react'

export default class LandingPage extends Component {
  render() {
    return (
      <div className="landing-page">
        <h1>Hello, Moodify </h1>
        <h2> The world-first music playlist generator based on how you look!</h2>
      </div>
    )
  }
}
